import React from 'react';
import logo from '../logo.jpeg'; // Update the path according to where the logo is stored

function Header() {
    return (
        <header>
            <img src={logo} alt="Munipal Logo" height="50" />
            <nav>
                <a href="#home">Home</a>
                <a href="#features">Features</a>
                <a href="#contact">Contact</a>
            </nav>
        </header>
    );
}

export default Header;
